/*
** convert floating numbers to C standard
** 1.2d-3 -> 1.2e-3
** 1.2D-3 -> 1.2e-3
*/
void scan_exponent_convert(char *in)
{
  for (; *in != 'd' && *in != 'D'; ++in);
  *in = 'e';
}

/*
** convert complex floating numbers to C standard
** 1.2i -> 1.2
** 1.2D-3i -> 1.2e-3
*/
void scan_complex_convert(char *in)
{
  for (; *in != 'i' && *in != 'j'; ++in) 
  {
    if (*in == 'd' || *in == 'D') 
    {
      *in = 'e';
    }
  }
  *in = ' ';
}

